import { createRouter, createWebHistory } from 'vue-router'
import BoardList from '@/views/board/BoardList.vue'
import BoardDetail from '@/views/board/BoardDetail.vue'
import SignupForm from '@/components/SignupForm.vue';
import FavoriteStations from '@/components/FavoriteStations.vue';
import LoginForm from '@/components/LoginForm.vue';
import BoardListJsonServer from '../views/BoardListJsonServer';
import PostForm from '../views/PostForm.vue';
import BoardView from '../views/BoardView.vue';
import BoardUpdate from '../views/BoardUpdate.vue';
import MyPage from '@/views/MyPage.vue';
import UserInfo from '@/components/UserInfo.vue';
import MyPosts from '@/components/MyPosts.vue';
import ChargeCredits from '@/components/ChargeCredits.vue';
import MyCoupons from '@/components/MyCoupons.vue';
import InquiriesPage from '@/components/InquiriesPage.vue';



const routes = [
  {
    path: '/',
    name: 'home',
    component: () => import('../views/HomeView.vue')
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
    path: '/boardlist',
    name: 'BoardList',
    component: BoardListJsonServer // 나중에 BoardList.vue로 바꿔주기
  },
  {
    path: '/board/list',
    name: 'BoardList2',
    component: BoardList
  },
  {
    path: '/board/detail',
    name: 'BoardDetail',
    component: BoardDetail
  },
  {
    path: '/signup',
    name: 'SignupForm',
    component: SignupForm
  },
  {
    path: '/login',
    name: 'LoginForm',
    component: LoginForm
  },

  { 
    path: '/post/new',
    name: 'PostBoard', 
    component: PostForm 
  },
  { 
    path: '/board/:id', 
    name:'boardView',
    component: BoardView 
  },
  {
    path: '/update/:id',
    name:'boardUpdate',
    component: BoardUpdate
  },
  {
    path: '/mypage',
    name: 'MyPage',
    component: MyPage,
    children: [
      {
        path: 'userinfo',
        component: UserInfo
      },
      {
        path: 'myposts',
        component: MyPosts
      },
      {
        path: 'favoritestations',
        component: FavoriteStations
      },
      {
        path: 'chargecredits',
        component: ChargeCredits
      },
      {
        path: 'mycoupons',
        component: MyCoupons
      },
      {
        path: 'inquiriespage',
        component: InquiriesPage
      }
    ]
  }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
